import React from 'react';
import styled from 'styled-components/macro';



export default function ShoppingCart() {

    const heinz = [
        [1, 'Bananen', 3, 1],
        [2, 'Cola', 1, 14],
        [3, 'Erdn端sse', 2, 6],
        [4, 'Fladenbrot', 1, 10],
        [5, 'Geranien', 1, 17],
        [6, 'Klopapier', 10, 21],
        [7, 'Limetten', 4, 1],
        [8, 'M端sli', 1, 9],
        [9, 'Schokolade', 3, 6],
        [10, 'Zimsterne', 3, 7],
    ];

    const ketchup = heinz.sort();
    console.log(ketchup);

    return (
        <div>
            <h1>Einkaufsliste</h1>
            <div>
                {heinz.map((item) => 
                    <ShoppingCartItemFlex>
                        <Amount>{JSON.stringify(item[2])}</Amount>
                        <Description>{JSON.stringify(item[0])}</Description>
                    </ShoppingCartItemFlex>
                )}
            </div>

        </div>


    );
}


const ShoppingCartItemFlex = styled.div`
    height: 15vw;
    left: 5px;
    right: 5px;
    display: flex;
    margin: 5px;
    background-image: linear-gradient(135deg, papayawhip, ivory);
    border-radius: 3px;
`
